import React from 'react';
import { Button } from '../../components/Button';

export const Login = () => {
    return (
        <div className="flex flex-col justify-center items-center rounded-2xl border-4 border-neutral-400 m-40">
            <p>Sign In</p>
            <label>Email adress</label>
            <input placeholder="Enter email"></input>
            <label>Password</label>
            <input placeholder="Password"></input>
            <Button background="" content={'Submit'}></Button>
            <p>
                Forgot <a>password?</a>
            </p>
        </div>
    );
};
